.DATA

outStr BYTE 256 DUP(0)
pausescreen BYTE "PAUSED",0
directions0 BYTE "Protect the treasure from mummies.",0
directions1 BYTE "Click powerups falling from the sky!",0
directions2 BYTE "[P]ause, [U]npause, [S]hoot",0
directions3 BYTE "Powerup:",0
bombtext BYTE "Bomb",0
barragetext BYTE "Barrage Fireballs",0
swordtext BYTE "Sword",0
levelup BYTE "Level Up!",0
gameover BYTE "Game Over!",0

;; sounds
hitSound BYTE "hitsound.wav",0
explosionSound BYTE "explosion.wav",0
music BYTE "music.wav",0

;; Constants
spriteTopLimit DWORD 240
spriteBottomLimit DWORD 410

Hero Sprite <offset hero_left_1,64,64,1,200,240>
HeroSword Sprite <offset hero_sword,64,64,1,200,200>
Background Sprite <offset bg, 768,480,1,320,225,0,0,1,1>
Clouds Sprite 4 DUP (<offset cloud, 80, 80, 1,?, ?, 0, 0, 1, 1>)
Mummies Sprite 20 DUP (<offset mummy_right_1, 40, 62, 1, ?, ?, 1, 0, 1, 3>)
Fireball Sprite <offset fireball_left, 7, 14, 0, ?, ?, 0, 0, 1, 20>
Fireball1 Sprite <offset fireball_left, 7, 14, 0, ?, ?, 0, 0, 1, 20>
Fireball2 Sprite <offset fireball_left, 7, 14, 0, ?, ?, 0, 0, 1, 20> 
Cursor Sprite <offset cursor, 64, 64, 1>
Treasure Sprite <offset treasure, 64, 64, 1, 580, 300>
Powerups Sprite 4 DUP (<offset crate, 64, 51, 0, ?, ?, 3, 0, 0, 2>)
Explosion Sprite <offset explosion_1,250,250,0,?,?,0,0,0,0>
Gravity DWORD 2
Level DWORD 1
HasSword DWORD 0
Barrage DWORD 0
HasBomb DWORD 0
Paused DWORD 0
NumMummies DWORD 20

hitStr BYTE "Ow!",0
waveStr BYTE "Wave %d",0
mummiesLeft BYTE "Mummies left: %d",0

.CODE

CheckCollision PROC uses ebx ecx edi esi sprite1:PTR Sprite, sprite2:PTR Sprite
LOCAL x1:DWORD, y1:DWORD, x2:DWORD, y2:DWORD

    mov edi, sprite1
    mov esi, sprite2
  
    cmp (Sprite PTR [edi]).visible, 0
    je no_collision
    cmp (Sprite PTR [esi]).visible, 0
    je no_collision

    mov eax, (Sprite ptr [edi]).x
    mov ebx, (Sprite ptr [edi]).dwWidth
    shr ebx, 1
    sub eax, ebx
    mov x1, eax

    mov eax, (Sprite ptr [esi]).x
    mov ebx, (Sprite ptr [esi]).dwWidth
    shr ebx, 1
    sub eax, ebx
    mov x2, eax

    mov eax, (Sprite ptr [edi]).y
    mov ebx, (Sprite ptr [edi]).dwHeight
    shr ebx, 1
    sub eax, ebx
    mov y1, eax
    
    mov eax, (Sprite ptr [esi]).y
    mov ebx, (Sprite ptr [esi]).dwHeight
    shr ebx, 1
    sub eax, ebx
    mov y2, eax 

    mov eax, x2
    add eax, (Sprite ptr [esi]).dwWidth
    cmp x1, eax
    jge no_collision

    mov eax, x1
    add eax, (Sprite ptr [edi]).dwWidth
    cmp eax, x2
    jle no_collision

    mov eax, y2
    add eax, (Sprite ptr [esi]).dwHeight
    cmp y1, eax
    jge no_collision

    mov eax, y1
    add eax, (Sprite ptr [edi]).dwHeight
    cmp eax, y2
    jle no_collision

    mov eax, 1
    ret
no_collision:
    mov eax, 0
    ret
CheckCollision ENDP

CheckFireballCollisions PROC uses ebx ecx edx edi esi fireballPtr:PTR Sprite
LOCAL fireball:DWORD, cursor:DWORD
    ;; iterate through mummies, check if hit by fireball or by sword
    lea edi, Mummies
    mov edx, SIZEOF Mummies
    add edx, edi
    mov ebx, TYPE Mummies
    mov eax, fireballPtr
    mov fireball, eax
    lea eax, Cursor
    mov cursor, eax
    jmp check
mummy_loop:
    invoke CheckCollision, fireball, edi
    cmp eax, 1
    je fireball_collision
    mov eax, cursor
    cmp (Sprite PTR [eax]).bitmapPtr, offset hero_sword
    jne increment
    invoke CheckCollision, cursor, edi
    cmp eax, 1
    je sword_collision
increment:
    add edi, ebx
check:
    cmp edi, edx
    jl mummy_loop
    ret
fireball_collision:
    mov eax, fireball
    mov (Sprite PTR [eax]).visible, 0
    mov (Sprite PTR [edi]).visible, 0
    jmp increment
sword_collision: 
    mov (Sprite PTR [edi]).visible, 0 
    jmp increment
CheckFireballCollisions ENDP

CheckHeroCollisions PROC uses ebx edi edi esi
    lea edi, Mummies
    mov edx, SIZEOF Mummies
    add edx, edi
    mov ebx, TYPE Mummies
    lea esi, Hero
    jmp check
mummy_loop:
    invoke CheckCollision, edi, esi
    add edi, ebx
    cmp eax, 1
    je collision
check:
    cmp edi, edx
    jl mummy_loop
    ret
collision:
    invoke GameOver
    ret
CheckHeroCollisions ENDP

CheckPowerupCollisions PROC uses ebx edi edi esi
    lea edi, Powerups
    mov edx, SIZEOF Powerups
    add edx, edi
    mov ebx, TYPE Powerups
    lea esi, Cursor
    jmp check
powerup_loop:
    invoke CheckCollision, edi, esi
    cmp eax, 1
    je collision
check:
    add edi, ebx
    cmp edi, edx
    jl powerup_loop
    ret
collision:
    mov eax, (Sprite PTR [edi]).cycle
    cmp eax, 1
    jle give_sword
    cmp eax, 2
    je barrage
    cmp eax, 3
    je give_bomb
give_sword:
    mov Barrage, 0
    mov HasBomb, 0
    mov HasSword, 1
    invoke GiveSword
    ret
barrage:
    mov HasSword, 0
    mov (Sprite PTR [esi]).bitmapPtr, offset cursor
    mov Barrage, 1
    ret
give_bomb:
    mov Barrage, 0
    mov HasSword, 0
    mov HasBomb, 1
    mov (Sprite PTR [esi]).bitmapPtr, offset bomb
    ret
CheckPowerupCollisions ENDP

DropBomb PROC uses edi esi
    lea esi, Cursor
    lea edi, Explosion
    mov (Sprite PTR [esi]).bitmapPtr, offset cursor
    mov (Sprite PTR [edi]).visible, 1
    mov eax, (Sprite PTR [esi]).x
    mov ebx, (Sprite PTR [esi]).y
    mov (Sprite PTR [edi]).x, eax
    mov (Sprite PTR [edi]).y, ebx
    ret
DropBomb ENDP

UpdateExplosion PROC uses esi
    lea esi, Explosion
    cmp (Sprite PTR [esi]).visible, 0
    je done
    invoke BasicBlit, (Sprite PTR [esi]).bitmapPtr, (Sprite PTR [esi]).x, (Sprite PTR [esi]).y
    mov eax, (Sprite PTR [esi]).cycle
    inc eax
    invoke UpdateExplosionBitmap, esi, (Sprite PTR [esi]).cycle
    invoke UpdateCycle, esi, 12    
    cmp (Sprite PTR [esi]).cycle, 12
    jge finished
    ret
finished:
    invoke KillMummies
done:
    mov (Sprite PTR [esi]).visible, 0
    ret
UpdateExplosion ENDP

KillMummies PROC uses edi edx ebx
     ;; kill em all
    lea edi, Mummies
    mov edx, TYPE Mummies
    mov ebx, 0
    jmp check
L1:
    mov (Sprite PTR [edi]).visible, 0
increment:
    inc ebx
    add edi, edx
check:
    cmp ebx, LENGTHOF Mummies
    jl L1
    ret

KillMummies ENDP

ShootFireBall PROC uses ebx edi esi fireball:PTR Sprite, y:DWORD
    mov edi, fireball
    lea esi, Hero
    movzx eax, (Sprite PTR [edi]).visible ;; if one's already visible don't make a new one!
    cmp eax, 1
    je done
    mov eax, (Sprite PTR [esi]).x
    mov ebx, y
    mov (Sprite PTR [edi]).visible, 1
    mov (Sprite PTR [edi]).x, eax
    mov (Sprite PTR [edi]).y, ebx
    jmp done
done:
    ret
ShootFireBall ENDP

UpdateFireball PROC uses edi fireball:PTR Sprite
    mov edi, fireball
    movzx eax, (Sprite PTR [edi]).visible
    cmp eax, 1
    je visible
    ret
visible: 
    invoke MoveSprite, edi, (Sprite PTR [edi]).direction
    invoke BasicBlit, (Sprite PTR [edi]).bitmapPtr, (Sprite PTR [edi]).x, (Sprite PTR [edi]).y
    cmp (Sprite PTR [edi]).x, -14
    jg done
    mov (Sprite PTR [edi]).visible, 0
done:
    ret
UpdateFireball ENDP

MoveSprite PROC uses ebx ecx esi sprite:PTR Sprite, direction:DWORD
    mov esi, sprite
    mov ebx, (Sprite PTR [esi]).speed
    cmp direction, 1
    je right
    cmp direction, 2
    je up
    cmp direction, 3
    je down
left:
    mov ecx, (Sprite PTR [esi]).x
    sub ecx, ebx
    mov (Sprite PTR [esi]).x, ecx
    ret
right:
    mov ecx, (Sprite PTR [esi]).x
    add ecx, ebx
    mov (Sprite PTR [esi]).x, ecx
    ret 
up:
    mov ecx, (Sprite PTR [esi]).y
    sub ecx, ebx
    cmp ecx, spriteTopLimit
    jle done
    mov (Sprite PTR [esi]).y, ecx
    ret
down:
    mov ecx, (Sprite PTR [esi]).y
    add ecx, ebx
    cmp ecx, spriteBottomLimit
    jge done
    mov (Sprite PTR [esi]).y, ecx
    ret
done:
    ret
MoveSprite ENDP

HandleInput PROC uses ebx edi esi
    mov esi, offset Hero
    mov edi, offset Background
    mov eax, KeyPress
    cmp Paused, 1
    je paused
    cmp eax, 050h
    je pause
    cmp eax, 053h
    je shoot
    cmp eax, 025h
    je left
    cmp eax, 026h
    je up
    cmp eax, 027h
    je right
    cmp eax, 028h
    je down
    lea eax, MouseStatus
    cmp (MouseInfo PTR [eax]).buttons, MK_LBUTTON
    je left_click
    jmp done
left:
    mov (Sprite PTR [esi]).direction, 0
    invoke MoveSprite, esi, 0
    invoke MoveSprite, edi, 1
    ret
right:
    mov (Sprite PTR [esi]).direction, 1
    invoke MoveSprite, esi, 1
    invoke MoveSprite, edi, 0
    ret
up:
    invoke MoveSprite, esi, 2
    mov (Sprite PTR [esi]).direction, 2
    ret
down:
    invoke MoveSprite, esi, 3
    mov (Sprite PTR [esi]).direction, 2
    ret
shoot:
    mov eax, Barrage
    cmp eax, 1
    je barrage_shoot
    invoke ShootFireBall, offset Fireball, (Sprite PTR [esi]).y
    jmp shoot_done
barrage_shoot:
    mov ebx, (Sprite PTR [esi]).y
    invoke ShootFireBall, offset Fireball, ebx
    add ebx, 15
    invoke ShootFireBall, offset Fireball1, ebx
    sub ebx, 30
    invoke ShootFireBall, offset Fireball2, ebx
shoot_done:
    mov (Sprite PTR [esi]).direction, 2
    ret
left_click:
    mov eax, HasBomb
    cmp eax, 1
    jne done
    invoke DropBomb
    jmp done
done:
    mov (Sprite PTR [esi]).direction, 2
    ret
pause:
    xor Paused, 1
    ret
paused:
    cmp eax, 055h
    je unpause
    ret
unpause:
    xor Paused, 1
    ret
HandleInput ENDP

UpdateCycle PROC uses ebx sprite:PTR Sprite, numCycles:DWORD
    mov eax, 0BEEFFEEBh   ;ollyyy
    mov ebx, sprite
    mov eax, (Sprite PTR [ebx]).cycle
    cmp eax, numCycles
    jl incr
    mov eax, -1
incr:
    inc eax
    mov (Sprite PTR [ebx]).cycle, eax
    ret
UpdateCycle ENDP

UpdateHeroBitmap PROC uses edi sprite:PTR Sprite
    mov edi, sprite
    mov eax, (Sprite PTR [edi]).direction
    cmp eax, 1
    je HeroRight
    cmp eax, 2
    je HeroStand
HeroLeft:
    mov eax, Hero.cycle
    cmp eax, 1
    jle HeroLeft0
    cmp eax, 3
    jle HeroLeft1
    cmp eax, 5
    jle HeroLeft2
    cmp eax, 7
    jle HeroLeft3
HeroLeft0:
    mov (Sprite PTR [edi]).bitmapPtr, OFFSET hero_left_0
    jmp HeroDone
HeroLeft1:
    mov (Sprite PTR [edi]).bitmapPtr, OFFSET hero_left_1
    jmp HeroDone
HeroLeft2:
    mov (Sprite PTR [edi]).bitmapPtr, OFFSET hero_left_2
    jmp HeroDone
HeroLeft3:
    mov (Sprite PTR [edi]).bitmapPtr, OFFSET hero_left_3
    jmp HeroDone
    
HeroRight:
    mov eax, Hero.cycle
    cmp eax, 1
    jle HeroRight1
    cmp eax, 3
    jle HeroRight1
    cmp eax, 5
    jle HeroRight2
    cmp eax, 7
    jle HeroRight3
HeroRight0:
    mov (Sprite PTR [edi]).bitmapPtr, OFFSET hero_right_0
    jmp HeroDone
HeroRight1:
    mov (Sprite PTR [edi]).bitmapPtr, OFFSET hero_right_1
    jmp HeroDone
HeroRight2:
    mov (Sprite PTR [edi]).bitmapPtr, OFFSET hero_right_2
    jmp HeroDone
HeroRight3:
    mov (Sprite PTR [edi]).bitmapPtr, OFFSET hero_right_3
    jmp HeroDone

HeroStand:
    mov (Sprite PTR [edi]).bitmapPtr, OFFSET hero_stand
    jmp HeroDone

HeroDone:
    ;;mov eax, 0   
    ret
UpdateHeroBitmap ENDP

CloudInit PROC uses ebx ecx edx edi
LOCAL incSize:DWORD
    ;; make dope clouds
    mov eax, 0BEEFFBFBh
    lea edi, Clouds
    mov incSize, TYPE Clouds
    mov ebx, 0
    jmp check
L1:
    invoke nrandom, 640
    mov (Sprite PTR [edi]).x, eax
    invoke nrandom, 200
    mov (Sprite PTR [edi]).y, eax
    invoke nrandom, 3
    add eax, 1
    mov (Sprite PTR [edi]).speed, eax
    add edi, incSize
    inc ebx
check:
    cmp ebx, LENGTHOF Clouds
    jl L1
    ret 
CloudInit ENDP

PowerupInit PROC uses ebx ecx edx edi
LOCAL incSize:DWORD
    ;; make some powerups
    lea edi, Powerups
    mov incSize, TYPE Powerups
    mov ebx, 0
    jmp check
L1:
    invoke nrandom, 480
    add eax, 100
    mov (Sprite PTR [edi]).x, eax
    mov (Sprite PTR [edi]).y, 0
    mov (Sprite PTR [edi]).visible, 0
    ;; being cheeky and letting cycle represent powerup type
    mov (Sprite PTR [edi]).cycle, ebx
    add edi, incSize
    inc ebx
check:
    cmp ebx, LENGTHOF Powerups
    jl L1
    ret
PowerupInit ENDP

MummyInit PROC uses ebx ecx edx edi
LOCAL incSize:DWORD
    ;; make some mummies
    lea edi, Mummies
    mov incSize, TYPE Mummies
    mov ebx, 0
    jmp check
L1:
    mov eax, spriteBottomLimit
    sub eax, spriteTopLimit
    invoke nrandom, eax
    add eax, spriteTopLimit
    mov (Sprite PTR [edi]).y, eax
    invoke nrandom, 1000
    sub eax, 1000
    mov (Sprite PTR [edi]).x, eax
    mov eax, Level
    mov ecx, 2
    mul ecx
    mov (Sprite PTR [edi]).speed, eax
    mov (Sprite PTR [edi]).visible, 1  ;; need to update visible after leveling up
    add edi, incSize
    inc ebx
check:
    cmp ebx, LENGTHOF Mummies
    jl L1
    ret
MummyInit ENDP

UpdateClouds PROC uses ebx ecx edx edi esi
    mov eax, 0BEEFFAFAh ;;olly
    ;; both moves and redraws clouds
    lea edi, Clouds
    mov edx, TYPE Clouds 
    mov ecx, 0
    jmp check
L1:
    mov eax, (Sprite PTR [edi]).x
    mov ebx, (Sprite PTR [edi]).y
    cmp eax, -80
    jg draw
    mov (Sprite PTR [edi]).x, 640
    mov eax, 640
draw:
    invoke BasicBlit, (Sprite PTR [edi]).bitmapPtr, eax, ebx
    invoke MoveSprite, edi, 0
    inc ecx
    add edi, edx
check:
    cmp ecx, LENGTHOF Clouds
    jl L1
    ret 

UpdateClouds ENDP

UpdateMummies PROC uses ebx ecx edx edi esi
LOCAL deadCount:DWORD
    ;; both moves and redraws mummies
    mov deadCount, 0
    mov eax, 0FECEFECEh
    lea edi, Mummies
    mov edx, TYPE Mummies
    mov ecx, 0
    jmp check
L1:
    movzx eax, (Sprite PTR [edi]).visible
    cmp eax, 0
    je dead
    invoke MoveSprite, edi, 1
    invoke UpdateCycle, edi, 4
    invoke UpdateMummyBitmap, edi, (Sprite PTR [edi]).cycle
    mov eax, (Sprite PTR [edi]).x
    cmp eax, 584
    jge game_over
    mov ebx, (Sprite PTR [edi]).y
    invoke BasicBlit, (Sprite PTR [edi]).bitmapPtr, eax, ebx
    jmp increment
game_over:
    invoke GameOver
    ret
dead:
    inc deadCount
increment:
    inc ecx
    add edi, edx
check:
    cmp ecx, LENGTHOF Mummies
    jl L1
    mov eax, 20
    sub eax, deadCount
    mov NumMummies, eax
    cmp deadCount, LENGTHOF Mummies
    je all_dead
    ret
all_dead:
    invoke LevelUp
 
    ret
UpdateMummies ENDP

UpdatePowerups PROC uses ebx ecx edx edi esi
LOCAL incSize:DWORD
    ;; both moves and redraws powerups
    lea edi, Powerups
    mov incSize, TYPE Powerups
    mov ebx, 0
    jmp check
L1:
    movzx eax, (Sprite PTR [edi]).visible
    cmp eax, 0
    je hidden
    mov eax, (Sprite PTR [edi]).speed
    add eax, Gravity
    mov (Sprite PTR [edi]).speed, eax
    invoke MoveSprite, edi, (Sprite PTR [edi]).direction
    invoke BasicBlit, (Sprite PTR [edi]).bitmapPtr, (Sprite PTR [edi]).x, (Sprite PTR [edi]).y
    jmp increment
hidden:
    invoke nrandom, 10000
    cmp eax, 10
    jge increment
    mov (Sprite PTR [edi]).visible, 1
increment:
    inc ebx
    add edi, incSize
check:
    cmp ebx, LENGTHOF Powerups
    jl L1
    ret
UpdatePowerups ENDP

UpdateMummyBitmap PROC uses edi mummyPtr:PTR Sprite, cycle:DWORD
    mov edi, mummyPtr
    cmp cycle, 2
    jge walk_2
walk_1:
    mov (Sprite PTR [edi]).bitmapPtr, OFFSET mummy_right_1
    ret
walk_2:
    mov (Sprite PTR [edi]).bitmapPtr, OFFSET mummy_right_2
    ret
UpdateMummyBitmap ENDP

UpdateExplosionBitmap PROC uses edi explosionPtr:PTR Sprite, cycle:DWORD
    mov edi, explosionPtr
    cmp cycle, 1
    jle one
    
    cmp cycle, 3
    jle two
    cmp cycle, 5
    jle three
    cmp cycle, 7
    jle four
    cmp cycle, 9
    jle five
    cmp cycle, 11
    jle six
one:
    mov eax, OFFSET explosion_1
    mov (Sprite PTR [edi]).bitmapPtr, eax
    ret
two:
    mov eax, OFFSET explosion_2
    mov (Sprite PTR [edi]).bitmapPtr, eax
    ret
three:
    mov eax, OFFSET explosion_3
    mov (Sprite PTR [edi]).bitmapPtr, eax
    ret
four:
    mov eax, OFFSET explosion_4
    mov (Sprite PTR [edi]).bitmapPtr, eax
    ret
five:
    mov eax, OFFSET explosion_6
    mov (Sprite PTR [edi]).bitmapPtr, eax
    ret
six:
    mov eax, OFFSET explosion_6
    mov (Sprite PTR [edi]).bitmapPtr, eax
    ret
    
    ret
UpdateExplosionBitmap ENDP


GameInit PROC uses esi
	;;
    invoke PlaySound, offset music, 0, SND_ASYNC + SND_FILENAME + SND_LOOP
    rdtsc
    invoke nseed, eax	
    invoke CloudInit
    invoke MummyInit
    invoke PowerupInit
	ret         ;; Do not delete this line!!!
GameInit ENDP


GamePlay PROC USES ebx ecx edi
    invoke HandleInput
    mov eax, Paused
    cmp eax, 1
    je Pause_Skip

Logic:
    ;; update the frame for Hero
    lea edi, Hero
    invoke UpdateCycle, edi, 8

    ;; update the bitmap for hero
    invoke UpdateHeroBitmap, edi

Draw:
    mov edi, 0BEEFCAFEh ;; ollydbg
    invoke BlackStarField

    ;; draw bg
    lea edi, Background
    mov eax, (Sprite PTR [edi]).x
    mov ebx, (Sprite PTR [edi]).y
    invoke BasicBlit, (Sprite PTR [edi]).bitmapPtr, eax, ebx

    ;; draw instructions
    invoke DrawStr, offset directions0, 10, 10, 0ffh
    invoke DrawStr, offset directions1, 10, 30, 0ffh
    invoke DrawStr, offset directions2, 10, 50, 0ffh
    invoke DrawStr, offset directions3, 10, 70, 0ffh
    mov eax, HasBomb
    cmp eax, 1
    jne check_sword
    invoke DrawStr, offset bombtext, 10, 90, 0bbh
    jmp done_text
check_sword:
    mov eax, HasSword
    cmp eax, 1
    jne check_barrage
    invoke DrawStr, offset swordtext, 10, 90, 0bbh
    jmp done_text
check_barrage:
    mov eax, Barrage
    cmp eax, 1
    jne done_text
    invoke DrawStr, offset barragetext, 10, 90, 0bbh
    jmp done_text
done_text:
    mov eax, Level
    push eax
    push offset waveStr
    push offset outStr
    call wsprintf
    add esp, 12
    invoke DrawStr, offset outStr, 10, 110, 0aah

    mov eax, NumMummies
    push eax
    push offset mummiesLeft
    push offset outStr
    call wsprintf
    add esp, 12
    invoke DrawStr, offset outStr, 10, 130, 0aah
    
    

    ;; draw clouds
    invoke UpdateClouds

    ;; draw mummies
    invoke UpdateMummies

    ;; draw powerups
    invoke UpdatePowerups
    
    ;; draw hero
    lea edi, Hero
    mov eax, (Sprite PTR [edi]).x
    mov ebx, (Sprite PTR [edi]).y
    invoke BasicBlit, (Sprite PTR [edi]).bitmapPtr, eax, ebx

    ;; draw any fireballs
    invoke UpdateFireball, offset Fireball
    invoke UpdateFireball, offset Fireball1
    invoke UpdateFireball, offset Fireball2

    ;; update that bomb
    invoke UpdateExplosion

    ;; draw cursor
    lea edi, MouseStatus
    mov eax, (MouseInfo PTR [edi]).horiz
    mov ebx, (MouseInfo PTR [edi]).vert
    mov esi, OFFSET Cursor
    invoke BasicBlit, (Sprite PTR [esi]).bitmapPtr, eax, ebx
    mov eax, (MouseInfo PTR [edi]).horiz
    mov ebx, (MouseInfo PTR [edi]).vert
    mov (Sprite PTR [esi]).x, eax
    mov (Sprite PTR [esi]).y, ebx

    ;; draw treasure
    lea esi, Treasure
    invoke BasicBlit, (Sprite PTR [esi]).bitmapPtr, (Sprite PTR [esi]).x, (Sprite PTR [esi]).y

    ;; check collisions
    invoke CheckFireballCollisions, offset Fireball
    invoke CheckFireballCollisions, offset Fireball1
    invoke CheckFireballCollisions, offset Fireball2
    invoke CheckHeroCollisions
    invoke CheckPowerupCollisions

Pause_Skip:
done:
	ret         ;; Do not delete this line!!!
GamePlay ENDP

LevelUp PROC
    inc Level
    invoke DrawStr, offset levelup, 320, 220, 0ffh
    xor Paused, 1
    invoke MummyInit
